import { useImperativeHandle, useRef } from "react";
import Video from "./Video";
function ImperctiveHandle() {
    const videoRef = useRef();
    const handlePlay = () => {
        videoRef.current.play();
    }
    return (
        <>
            <Video ref={videoRef} />
        </>
    )
}
export default ImperctiveHandle;
